import React, { useState } from "react";
import ReactDOM from "react-dom";
import { Card, Button } from "react-bootstrap";
import "bootstrap/dist/css/bootstrap.min.css";

function Public() {
  const [index, setIndex] = useState(0);
  const [direction, setDirection] = useState(null);

  const handleSelect = (selectedIndex, e) => {
    setIndex(selectedIndex);
    setDirection(e.direction);
  };

  return (
    <div class="public">
      <h2 class="page-section-heading text-center text-uppercase mb-0">
        Public Projects
      </h2>
      <p>
        Hello..... Its me..... This is Home and there will be a round icon that
        is me
      </p>
      <div class="row">
        <Card text="black" style={{ width: "18rem" }}>
          <Card.Img
            variant="top"
            src="data:image/png;base64,"
          />
          <Card.Body>
            <Card.Title>Title</Card.Title>
            <Card.Text>Random Text</Card.Text>
            <Button varient="primary">Go</Button>
          </Card.Body>
        </Card>
      </div>
    </div>
  );
}

export default Public;
